from typing import List
import math


class Solution:
    def outerTrees(self, trees: List[List[int]]) -> List[List[int]]:

        if len(trees) <= 2:
            return trees

        def get_cos(p1: List[int], p2: List[int], p3: List[int]) -> float:
            v1 = (p2[0] - p1[0], p2[1] - p1[1])
            v2 = (p3[0] - p2[0], p3[1] - p2[1])
            return (v1[0] * v2[0] + v1[1] * v2[1]) / (math.hypot(v1[0], v1[1]) * math.hypot(v2[0], v2[1]))

        def get_dist(p1: List[int], p2: List[int]) -> float:
            return math.hypot(p2[0] - p1[0], p2[1] - p1[1])

        fence = []
        trees.sort()
        p1 = [trees[0][0], trees[0][1]]
        p0 = [p1[0], p1[1] - 101]
        ps = p1
        ind = 0
        while (True):
            fence.append(p1)
            max_cos = -1
            pn = None
            for ind in range(len(trees)):
                p2 = [trees[ind][0], trees[ind][1]]
                if p1 != p2 and p0 != p2:
                    cur_cos = get_cos(p0, p1, p2)
                    if cur_cos > max_cos + 0.00001 or\
                            (abs(cur_cos - max_cos) < 0.00001 and (pn is None or get_dist(p1, p2) < get_dist(p1, pn))):
                        max_cos = cur_cos
                        pn = p2
            if max_cos == -1:
                return fence
            if pn == ps:
                return fence
            p0 = p1
            p1 = pn


